create or replace view aggJoin4692999942562573846 as select l_quantity as v5, l_extendedprice as v6, l_discount as v7, l_shipinstruct as v14, l_shipmode as v15 from lineitem as lineitem, aggView6846682359920167757 where lineitem.l_partkey=aggView6846682359920167757.v17 and l_quantity>=21 and l_shipinstruct= 'DELIVER IN PERSON' and l_quantity<=21 + 10 and l_shipmode IN ('AIR','AIR REG');
